							<div id="tab-panel-overview" class="help-tab-content active">
								<p>This screen is used for managing your installed themes. Aside from the default theme(s) included with your WordPress installation, themes are designed and developed by third parties.</p>
<p>From this screen you can:</p>
<ul>
<li>Hover or tap to see Activate and Live Preview buttons</li>
<li>Click on the theme to see the theme name, version, author, description, tags, and the Delete link</li>
<li>Click Customize for the active theme or Live Preview for any other theme to see a live preview</li>
</ul>
<p>The active theme is displayed highlighted as the first theme.</p>
<p>The search for installed themes will search for terms in their name, description, author, or tag. <span id="live-search-desc">The search results will be updated as you type.</span></p>							</div>
							
							<div id="tab-panel-adding-themes" class="help-tab-content">
								<p>If you would like to see more themes to choose from, click on the &#8220;Add New Theme&#8221; button and you will be able to browse or search for additional themes from the <a href="https://wordpress.org/themes/">WordPress Theme Directory</a>. Themes in the WordPress Theme Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they&#8217;re free!</p>							</div>
							
							<div id="tab-panel-customize-preview-themes" class="help-tab-content">
								<p>Tap or hover on any theme then click the Live Preview button to see a live preview of that theme and change theme options in a separate, full-screen view. You can also find a Live Preview button at the bottom of the theme details screen. Any installed theme can be previewed and customized in this way.</p>
<p>The theme being previewed is fully interactive &mdash; navigate to different pages to see how the theme handles posts, archives, and other page templates. The settings may differ depending on what theme features the theme being previewed supports. To accept the new settings and activate the theme all in one step, click the Activate &amp; Publish button above the menu.</p>
<p>When previewing on smaller monitors, you can use the collapse icon at the bottom of the left-hand pane. This will hide the pane, giving you more room to preview your site in the new theme. To bring the pane back, click on the collapse icon again.</p>							</div>
							
